import React, { useState, useEffect } from 'react';

const DataPanel = ({ onDataUpload, onManualAdd, stations, selectedLocation }) => {
  const [stationData, setStationData] = useState({
    latitude: '',
    longitude: '',
    precipitation: '',
  });

  // Update input fields when a location is selected on the map
  useEffect(() => {
    if (selectedLocation) {
      setStationData(prev => ({
        ...prev,
        latitude: selectedLocation.lat.toFixed(6),
        longitude: selectedLocation.lng.toFixed(6)
      }));
    }
  }, [selectedLocation]);

  const handleFileUpload = (event) => {
    const file = event.target.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onload = (e) => {
        try {
          const csvData = e.target.result;
          // Parse CSV data
          const parsedData = csvData.split('\\n').map(row => row.split(','));
          onDataUpload(parsedData);
        } catch (error) {
          console.error('Error parsing CSV:', error);
          alert('Error parsing CSV file');
        }
      };
      reader.readAsText(file);
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onManualAdd(stationData);
    setStationData({
      latitude: '',
      longitude: '',
      precipitation: '',
    });
  };

  return (
    <div className="bg-white p-4 rounded-lg shadow">
      <h2 className="text-xl font-bold mb-4">Station Data</h2>

      {/* File Upload Section */}
      <div className="mb-6">
        <h3 className="font-semibold mb-2">Upload CSV</h3>
        <input
          type="file"
          accept=".csv"
          onChange={handleFileUpload}
          className="w-full p-2 border rounded"
        />
        <p className="mt-1 text-sm text-gray-500">
          CSV format: latitude,longitude,precipitation
        </p>
      </div>

      {/* Station Input Form */}
      <form onSubmit={handleSubmit}>
        <h3 className="font-semibold mb-2">Add Station</h3>
        <div className="space-y-3">
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">
              Latitude
            </label>
            <input
              type="number"
              value={stationData.latitude}
              onChange={(e) => setStationData({...stationData, latitude: e.target.value})}
              className="w-full p-2 border rounded"
              step="any"
              required
            />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">
              Longitude
            </label>
            <input
              type="number"
              value={stationData.longitude}
              onChange={(e) => setStationData({...stationData, longitude: e.target.value})}
              className="w-full p-2 border rounded"
              step="any"
              required
            />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">
              Precipitation (mm)
            </label>
            <input
              type="number"
              value={stationData.precipitation}
              onChange={(e) => setStationData({...stationData, precipitation: e.target.value})}
              className="w-full p-2 border rounded"
              step="any"
              required
            />
          </div>
          <button
            type="submit"
            className="w-full bg-blue-500 text-white p-2 rounded hover:bg-blue-600"
          >
            Add Station
          </button>
        </div>
      </form>

      {/* Stations List */}
      {stations.length > 0 && (
        <div className="mt-6">
          <h3 className="font-semibold mb-2">Added Stations</h3>
          <div className="max-h-60 overflow-y-auto">
            <table className="min-w-full divide-y divide-gray-200">
              <thead className="bg-gray-50">
                <tr>
                  <th className="px-3 py-2 text-left text-xs font-medium text-gray-500 uppercase">Name</th>
                  <th className="px-3 py-2 text-left text-xs font-medium text-gray-500 uppercase">Lat</th>
                  <th className="px-3 py-2 text-left text-xs font-medium text-gray-500 uppercase">Long</th>
                  <th className="px-3 py-2 text-left text-xs font-medium text-gray-500 uppercase">Precip</th>
                </tr>
              </thead>
              <tbody className="bg-white divide-y divide-gray-200">
                {stations.map((station, index) => (
                  <tr key={index} className="hover:bg-gray-50">
                    <td className="px-3 py-2 text-sm">{station.name}</td>
                    <td className="px-3 py-2 text-sm">{station.lat.toFixed(6)}</td>
                    <td className="px-3 py-2 text-sm">{station.lng.toFixed(6)}</td>
                    <td className="px-3 py-2 text-sm">{station.precipitation} mm</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      )}
    </div>
  );
};

export default DataPanel;
